import React, { useState } from "react";
import { saveResponse } from "./saveResponse";

function App() {
  const [saved, setSaved] = useState(false); // ✅ 저장 상태 상태변수

  const handleTestSave = () => {
    saveResponse({
      userId: "test123",
      typeScores: {
        1: 20, 2: 15, 3: 18, 4: 22, 5: 17,
        6: 14, 7: 19, 8: 16, 9: 21
      },
      selectedAdjectives: ["열정적", "진지함", "직관적"]
    }).then(() => {
      setSaved(true); // ✅ 저장 성공 시 메시지 표시
    });
  };

  return (
    <div style={{ padding: "2rem" }}>
      <h1>에니어그램 앱 테스트</h1>
      <button onClick={handleTestSave}>응답 저장 테스트</button>

      {saved && (
        <p style={{ marginTop: "1rem", color: "green" }}>
          ✅ 응답이 저장되었습니다.
        </p>
      )}
    </div>
  );
}

export default App;
